// src/components/Section/Section.jsx

import React from 'react';
import './Section.css';

const Section = ({ title, content, buttonText, buttonAction }) => {
  return (
    <section className="section">
      <h2>{title}</h2>
      <p>{content}</p>
      {buttonText && buttonAction && (
        <button className="cta-button" onClick={buttonAction}>
          {buttonText}
        </button>
      )}
    </section>
  );
};

export default Section;
